<Admin_Passwd ua="rw">adminpass</Admin_Passwd>
<User_Password ua="rw">adminpass</User_Password>

<!-- Internet Connection Settings -->

<DHCP ua="rw">Yes</DHCP>

<!-- Optional Settings -->

<HostName ua="rw">linksys-pap2t</HostName>
<Domain ua="rw"></Domain>
<Primary_DNS ua="rw"></Primary_DNS>
<DNS_Server_Order ua="na">Manual,DHCP</DNS_Server_Order>
<Primary_NTP_Server ua="na">192.168.0.254</Primary_NTP_Server>

<!-- Configuration Profile -->

<Provision_Enable ua="na">Yes</Provision_Enable>
<Resync_Periodic ua="na">0</Resync_Periodic>
