<Resync_Fails_On_FNF ua="na">Yes</Resync_Fails_On_FNF>
<Profile_Rule ua="na">/init.cfg</Profile_Rule>
<Profile_Rule_B ua="na">/Linksys/pap2t-$MA.cfg</Profile_Rule_B>

<!-- Firmware Upgrade -->

<Upgrade_Enable ua="na">Yes</Upgrade_Enable>
<Upgrade_Rule>(!5.1.6)?/Linksys/firmware/pap2t-5-1-6.bin</Upgrade_Rule>

