<Cfwd_Dial_Tone ua="na">440@-10;*(1/.1/1)</Cfwd_Dial_Tone>
<DND_Dial_Tone ua="na">440@-19;2(.2/.2/2);10(*/0/1+2)</DND_Dial_Tone>
<Holding_Tone ua="na">440@-19;25(.1/.1/1,.1/.1/1,.1/9.5/1)</Holding_Tone>
